import * as React from "react";
import {
  View,
  Text,
  StyleSheet,
  Image,
  Pressable,
  StatusBar,
} from "react-native";
import { TextInput as RNPTextInput } from "react-native-paper";
import { Color, FontFamily, FontSize, Padding, Border } from "../GlobalStyles";

const CreateGroup = () => {
  return (
    <View style={styles.createGroup}>
      <View style={styles.strictlyAdhereToMmuCommuniParent}>
        <Text
          style={styles.strictlyAdhereToTypo}
        >{`Strictly adhere to MMU community guidelines and keep your  language
       in line with the school rules. `}</Text>
        <Text style={[styles.ensureYouMaintain, styles.strictlyAdhereToTypo]}>
          Ensure you maintain school conduct too in all conversations
        </Text>
      </View>
      <View style={styles.campusVibesWrapper}>
        <Text style={styles.campusVibes}>Campus vibes</Text>
      </View>
      <View style={[styles.groupNameParent, styles.parentFlexBox]}>
        <RNPTextInput
          placeholder="Group name"
          label="Label"
          mode="flat"
          placeholderTextColor="rgba(0, 0, 0, 0.5)"
          theme={{
            fonts: {
              regular: { fontFamily: "Inter", fontWeight: "Semi Bold" },
            },
            colors: { text: "rgba(0, 0, 0, 0.5)" },
          }}
        />
        <Image
          style={styles.iconCheckCircle}
          resizeMode="cover"
          source={require("../assets/-icon-check-circle.png")}
        />
      </View>
      <View style={styles.descriptionParent}>
        <RNPTextInput
          placeholder="Description"
          label="Label"
          mode="flat"
          placeholderTextColor="#707070"
          theme={{
            fonts: { regular: { fontFamily: "Inter", fontWeight: "Regular" } },
            colors: { text: "#000" },
          }}
        />
        <Image
          style={styles.iconInfoCircle}
          resizeMode="cover"
          source={require("../assets/-icon-info-circle.png")}
        />
      </View>
      <View style={[styles.addParticipantsParent, styles.parentFlexBox]}>
        <Text style={[styles.addParticipants, styles.createGroup1Typo]}>
          Add participants
        </Text>
        <View style={[styles.search, styles.searchSpaceBlock]}>
          <RNPTextInput
            placeholder="Type to search"
            label="Label"
            mode="flat"
            placeholderTextColor="#707070"
            theme={{
              fonts: { regular: { fontFamily: "Inter", fontWeight: "Medium" } },
              colors: { text: "#000" },
            }}
          />
        </View>
      </View>
      <View style={[styles.iconFilterLeftParent, styles.parentFlexBox]}>
        <View style={styles.iconFilterLeft} />
        <View style={styles.frameChild} />
        <View style={styles.frameChild} />
        <View style={styles.frameChild} />
        <View style={styles.frameChild} />
      </View>
      <Pressable
        style={[styles.createGroupWrapper, styles.searchSpaceBlock]}
        onPress={() => {}}
      >
        <Text style={[styles.createGroup1, styles.createGroup1Typo]}>
          Create Group
        </Text>
      </Pressable>
      <View style={styles.header}>
        <StatusBar barStyle="default" />
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  strictlyAdhereToTypo: {
    textAlign: "left",
    color: Color.gray_400,
    fontFamily: FontFamily.interRegular,
    fontSize: FontSize.size_3xs,
  },
  parentFlexBox: {
    alignItems: "center",
    flexDirection: "row",
    position: "absolute",
  },
  createGroup1Typo: {
    fontSize: FontSize.size_smi,
    fontFamily: FontFamily.interMedium,
    fontWeight: "500",
    textAlign: "left",
  },
  searchSpaceBlock: {
    paddingVertical: Padding.p_4xs,
    flexDirection: "row",
  },
  ensureYouMaintain: {
    marginTop: 2,
  },
  strictlyAdhereToMmuCommuniParent: {
    top: 751,
    left: 10,
    position: "absolute",
  },
  campusVibes: {
    color: Color.black,
    fontFamily: FontFamily.interMedium,
    fontWeight: "500",
    textAlign: "left",
    fontSize: FontSize.size_3xs,
  },
  campusVibesWrapper: {
    top: 812,
    left: 152,
    padding: Padding.p_3xs,
    flexDirection: "row",
    position: "absolute",
  },
  iconCheckCircle: {
    width: 20,
    height: 20,
    marginLeft: 233,
  },
  groupNameParent: {
    top: 116,
    left: 23,
  },
  iconInfoCircle: {
    width: 15,
    height: 15,
    marginTop: 90,
  },
  descriptionParent: {
    top: 142,
    borderStyle: "solid",
    borderColor: "#c0c0c0",
    borderTopWidth: 1,
    width: 348,
    height: 141,
    padding: Padding.p_4xs,
    backgroundColor: Color.white,
    left: 23,
    position: "absolute",
    overflow: "hidden",
  },
  addParticipants: {
    color: Color.black,
  },
  search: {
    borderRadius: Border.br_xl,
    width: 208,
    paddingHorizontal: Padding.p_4xl,
    marginLeft: 11,
    backgroundColor: Color.white,
  },
  addParticipantsParent: {
    top: 305,
    left: 23,
  },
  iconFilterLeft: {
    display: "none",
  },
  frameChild: {
    marginLeft: 20,
    display: "none",
  },
  iconFilterLeftParent: {
    top: 343,
    left: 24,
  },
  createGroup1: {
    color: Color.white,
  },
  createGroupWrapper: {
    top: 678,
    left: 34,
    borderRadius: Border.br_3xs,
    backgroundColor: Color.steelblue_200,
    paddingHorizontal: 113,
    position: "absolute",
  },
  header: {
    top: 0,
    left: 0,
    position: "absolute",
  },
  createGroup: {
    backgroundColor: Color.whitesmoke_100,
    flex: 1,
    width: "100%",
    height: 852,
    overflow: "hidden",
  },
});

export default CreateGroup;
